import React from 'react';

const SearchCountry = () => {
  return (
    <div>
      <form className='form-group py-4'>
        <input
          type='text'
          className='form-control'
          placeholder='Sarch a Country'
        />
        <input type='submit' value='Search' />
      </form>
    </div>
  );
};

export default SearchCountry;
